import React, { useState } from 'react';
import './data.css';
import { useHistory } from 'react-router-dom';
import { Box, TextField, Button, CloseIcon } from '@mui/material';
import axios from 'axios';
import { Select, MenuItem } from '@mui/material';




export default function Data() {
  
  const [config, setConfig] = useState({
    name: '',
    sets: '',
    reps: '',
    unit: '',
    date: '',
  });

  let history = useHistory();
  const submit = async (e) => {
    e.preventDefault();
    try {
      const data = await axios.get('http://localhost:5000/student');
      console.lo
    } catch (error) {
      console.log(error);
    }
    history.push('preview');
  };

  return (
    <>
      <div className='data'>
      
        <div className='mdata'>
          <h1>My Fitness Tracker</h1>
          <div>
            <Box
              component='form'
              sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
              }}
              noValidate
              autoComplete='off'
               >
              <TextField required
                id='outlined-basic'
                select
                label='Exercise Name'
                variant='outlined'
                
              
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, name: e.target.value }))
                }>
                <MenuItem value={1}>Pushup</MenuItem>
                <MenuItem value={2}>Thrusters</MenuItem>
                <MenuItem value={3}> Knees-to-Elbows</MenuItem>
                <MenuItem value={4}>Deadlifts</MenuItem>
                <MenuItem value={5}>burpees</MenuItem>
                <MenuItem value={6}> Kettlebell Swings</MenuItem>
                <MenuItem value={7}>Pull-Ups</MenuItem>
                
                </TextField>
                <TextField
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, sets: e.target.value }))
                }
                label='Sets'
                type = 'number'
                variant='outlined'
              />
            </Box>
          </div>

          <div>
            <Box
              component='form'
              sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
              }}
              noValidate
              autoComplete='off'
            >
              <TextField
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, reps: e.target.value }))
                }
                label='Reps'
                variant='outlined'
                type = 'number'
              />
              <TextField
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, unit: e.target.value }))
                }
                label='Unit'
                variant='outlined'
                type = 'number'
              />
            </Box>
          </div>

          <div>
              
              
            <Box
              component='form'
              sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
                 
              }}
              noValidate
              autoComplete='off'
              
            >
             <TextField
               
                required
                id='outlined-basic'
                onChange={(e) =>
                  setConfig((pv) => ({ ...pv, date: e.target.value }))
                }
                variant='outlined'
                type = 'Date'
              />
              
            </Box>
          </div>
          <div>
            <Button variant='contained' onClick={submit}>
              Submit
            </Button>
          </div>
        </div>
      </div>
    </>
  );
}
